import React from "react";

import "../../../index.css";

import { Link } from "react-router-dom";

import { Row, Col, Button } from "react-bootstrap";

const NotFound = () => {
  return (
    <div className="notFound">
      <div className="full">
        <Row className="bad-gateway-row">
          <Col md="8">
            <h2 className="h2-responsive mt-3 mb-2 text-info shasow">404. That's an error.</h2>
            <h4 className="text-info">The requested URL was not found on this server.</h4>
            <Link to="/"><Button variant="outline">Back to Main</Button></Link>
          </Col>
        </Row>
      </div>
    </div>
  );
};

export default NotFound;
